INSERT INTO `faqs` VALUES (1,'Why is this important?','<p>Because over 90% of businesses in Eswatini are MSMEs, employing about 75% of the national workforce, yet most of them remain informal, invisible, and disconnected from key opportunities. The MSME Registry Portal changes this by giving these businesses a national platform where they can be discovered, access customers, and grow. It strengthens the country’s economic backbone by making MSMEs visible, connected, and easier to support.</p>','2025-11-25 13:41:11','2025-11-25 13:41:11',NULL),(2,'Do I have to pay to have a profile on the MSME platform?','<p>No. It is completely free. Creating and maintaining your MSME profile does not require any payment, and it is tax-free-there are no tax implications or charges associated with registering your business on the platform.</p>','2025-11-25 13:47:35','2025-11-25 13:47:35',NULL);
/*!40000 ALTER TABLE `faqs` ENABLE KEYS */;
UNLOCK TABLES;

